  def mapList2(grantNum1:Any,grantCount1:Any,list2:Array[Row], r:Int)={
    var grantNum2:Any=null
    var grantCount2:Any=null
    list2.foreach(record => {
      grantNum2 = record(0)
      grantCount2 = record(1)
      if(grantNum2==grantNum1) {
        val rate = getResult(grantCount1.toString.toDouble, grantCount2.toString.toDouble)
        mapArray(grantNum2, rate, r)
      }
    })
  }
  def getResult(num: Double, den: Double): Double = {
    var result = 0.0
    result = if (den!= 0) (num/den) else 0.0;
    return result
  }


  def getMedianResult(rule: DataFrame): Double = {
    var result = 0.0
    if (rule.count > 0) {
      val coll: Array[Any] = rule.rdd.map(r => r(1)).collect()
      val intArr: Array[Double] = coll.map(_.toString).map(_.toDouble)
      println(intArr.length)
      if ((intArr.length / 2) * 2 == intArr.length) {
        val b = ((intArr.length / 2)).toInt
        val a = ((intArr.length / 2) - 1).toInt
        result = (intArr.apply(a) + intArr.apply(b)) / 2

      } else {
        if (intArr.length == 1) {
          result = intArr.apply(0)
        } else {
          val a = ((intArr.length / 2) + 1).toInt
          result = intArr.apply(a)
        }
      }
    } else {
      result = 0.00
    }
    return result
  }

